from sympy import factorint
from itertools import count
def f(k):
    c = k - sum(p*e for p, e in factorint(k).items())
    return 0 if c <= 1 else sum(factorint(c).values())
def a(n):
    return next(k for k in count(2**n) if f(k) == n)
